import React, { Component } from "react";

class Footer extends Component{
    render(){
        return (
            <footer className="py-3 bg-dark">
                <div className="container px-4 px-lg-5">
                    <p className="m-0 text-center text-white">PAE</p>
                </div>
            </footer>
        );
    }
}
export default Footer;
